import React from "react";
import "./App.css";
import { ThemeProvider } from "@mui/material/styles";
import { theme } from "./Theme";
import { CssBaseline, Typography } from "@mui/material";

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline>
        <Typography>Hello</Typography>
      </CssBaseline>
    </ThemeProvider>
  );
}

export default App;
